pragma solidity ^0.8.7;

contract test {

    event Transfer(address to, address from, uint256 amount);

    uint256[100] private array;

    function unsafe_i(uint256 i) private pure returns (uint256){
        unchecked{return i + 1;}
    }

    function testing () external {
        uint256 length = array.length;
        for(uint256 i = 0; i < length; i=unsafe_i(i)){
            array[i]++;
        }
    }

}

